CREATE DEFINER=`root`@`localhost` PROCEDURE `Get100PercentAttendanceTopN` (IN `p_year` INT, IN `p_month` INT, IN `p_topN` INT)   BEGIN
    DECLARE totalNoOfMonths INT DEFAULT 0;
    
	
			
    -- Temporary table to store results
    CREATE TEMPORARY TABLE tmp_result AS
    SELECT
        *,
        ((Present + weeklyOffs) / totalDays) * 100 AS OverAllpercent
    FROM
    (
        SELECT
            u.id,
			 TRIM(
            REGEXP_REPLACE(
                CONCAT_WS(
                    ' ',
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.f_name, 1)),
                            LOWER(SUBSTRING(u.f_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.m_name, 1)),
                            LOWER(SUBSTRING(u.m_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.l_name, 1)),
                            LOWER(SUBSTRING(u.l_name, 2))
                        ),
                        ''
                    )
                ),
                '\\s+',
                ' '
            )
        ) AS name,
            cl.*,
            u.Weekly_Off,
            (
                SELECT COUNT(1)
                FROM all_attandencetable AS a
                WHERE a.Employee_id = u.id AND a.attandence_Date BETWEEN cl.startdate AND cl.enddate
            ) AS Present,
            (
                SELECT COUNT(1)
                FROM all_attandencetable AS a
                INNER JOIN shift_master sh ON u.shift_time = sh.id
                WHERE a.Employee_id = u.id AND a.attandence_Date BETWEEN cl.startdate AND cl.enddate
                  AND a.in_time > sh.Shift_Start_Time + INTERVAL 5 MINUTE
            ) AS LateEntry,
            (
                SELECT COUNT(1)
                FROM calendar AS w
                WHERE w.Date BETWEEN cl.startdate AND cl.enddate AND DAYNAME(w.date) = u.Weekly_Off
            ) AS WeeklyOffs
        FROM
            all_users u
        INNER JOIN
        (
            SELECT 
                YEAR,
                month,
                MIN(DATE) AS StartDate,
                MAX(DATE) AS EndDate,
                COUNT(1) AS TotalDays
            FROM calendar
            WHERE YEAR = p_year
              AND (p_month = 0 OR month = p_month) -- Conditional month filter
			  and date<= CURRENT_DATE()
            and date not in (select holiday_date  from holiday_master)
            GROUP BY YEAR, month
        ) AS cl ON 1 = 1
    ) AS vw
    WHERE totalDays - Present - weeklyOffs <= 0
    ORDER BY month, LateEntry, OverAllpercent DESC;

    -- Get the total number of months for filtering
    SELECT COUNT(DISTINCT month) INTO totalNoOfMonths FROM tmp_result;

    -- Conditionally return the top N results
    IF p_topN > 0 THEN
        IF p_month <> 0 THEN
            -- Return only the top N records for a specific month
            SELECT * FROM tmp_result LIMIT p_topN;
        ELSE
            -- For all months, select top N records with 100% attendance for all months
            SELECT * FROM (
                SELECT id,name, Sum(Present) as Present,Sum(LateEntry) as LateEntry,Sum(weeklyOffs) as weeklyOffs, Avg(OverallPercent) as OverAllPercent
                FROM tmp_result
                GROUP BY id,name
                HAVING COUNT(DISTINCT month) = totalNoOfMonths
            ) AS y
			order by LateEntry, OverAllPercent desc, name
            LIMIT p_topN;
        END IF;
    ELSE
        -- Return all records
        SELECT * FROM tmp_result;
    END IF;

    -- Cleanup temporary table
    DROP TEMPORARY TABLE IF EXISTS tmp_result;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAbsenteesByDate` (IN `input_date` DATE)   BEGIN
    SELECT
        *
    FROM
        (
        SELECT
            DATE,
            vw.Shift_Name AS Shift_name,
            vw.EmployeeID AS EmployeeID,
            vw.name AS name
        FROM
            (
            SELECT
                sh.Shift_Name AS Shift_Name,
                sh.Shift_Start_Time AS Shift_Start_Time,
                CURTIME() BETWEEN sh.Shift_Start_Time AND sh.Shift_End_Time AS ShiftStart, 
                TRIM(
                    REGEXP_REPLACE(
                        CONCAT_WS(
                            ' ',
                            COALESCE(
                                CONCAT(
                                    UCASE(LEFT(u.f_name, 1)),
                                    LCASE(SUBSTR(u.f_name, 2))
                                ),
                                ''
                            ),
                            COALESCE(
                                CONCAT(
                                    UCASE(LEFT(u.m_name, 1)),
                                    LCASE(SUBSTR(u.m_name, 2))
                                ),
                                ''
                            ),
                            COALESCE(
                                CONCAT(
                                    UCASE(LEFT(u.l_name, 1)),
                                    LCASE(SUBSTR(u.l_name, 2))
                                ),
                                ''
                            )
                        ),
                        '\\s+',
                        ' '
                    )
                ) AS name,
                u.id AS EmployeeID,
                cl.date
            FROM
                (
                    (
                        (
                            all_users u
                        JOIN shift_master sh ON
                            (u.shift_time = sh.id)
                        )
                    INNER JOIN calendar cl ON
                        1 = 1
                    LEFT JOIN all_attandencetable a ON
                        (
                            u.Employee_id = a.Employee_id AND a.attandence_Date = cl.date
                        )
                    )
                
                )
            WHERE
                (
                    u.DOJ IS NULL OR u.DOJ <= cl.date
                ) AND(
                    u.termination_date IS NULL OR u.termination_date >= cl.date
                ) AND a.Employee_id IS NULL
            ) vw
        WHERE
            
           vw.date = input_date
        ) AS vww
    ORDER BY 
        vww.Shift_name ASC, 
        vww.name ASC;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetDefaultAbsenteesByMonth` (IN `input_month` VARCHAR(7))   BEGIN
		-- Set @input_month = '2024-11'; -- 'YYYY-MM' format
    -- Temporary table to store absence data for easier manipulation
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_absences (
        EmployeeID INT, name varchar(200),
        absence_date DATE
    );
    
    -- Insert the absence data into the temporary table
    SELECT 
        u.id AS EmployeeID, TRIM(
            REGEXP_REPLACE(
                CONCAT_WS(
                    ' ',
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.f_name, 1)),
                            LOWER(SUBSTRING(u.f_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.m_name, 1)),
                            LOWER(SUBSTRING(u.m_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.l_name, 1)),
                            LOWER(SUBSTRING(u.l_name, 2))
                        ),
                        ''
                    )
                ),
                '\\s+',
                ' '
            )
        ) AS name,
        cl.date
    FROM 
        all_users u
    INNER JOIN calendar cl ON 
        DATE_FORMAT(cl.date, '%Y-%m') = input_month  -- Filter by input month
    LEFT JOIN all_attandencetable a ON 
        u.id = a.Employee_id AND a.attandence_Date = cl.date
    WHERE 
        (u.DOJ IS NULL OR u.DOJ <= cl.date)
        AND (u.termination_date IS NULL OR u.termination_date >= cl.date)
        AND (a.Employee_id IS NULL)  -- Absentee check (no attendance record)
        AND DAYNAME(cl.date) != u.weekly_Off; -- Exclude weekly off days
    
    -- Check the count of absences before excluding holidays
--    SELECT COUNT(*) FROM temp_absences;

    -- Exclude absences that fall on holidays
    DELETE FROM temp_absences 
    WHERE absence_date IN (SELECT holiday_Date FROM holiday_master);

    -- Check the count of absences after excluding holidays
  --  SELECT * FROM temp_absences order by Employeeid, absence_date;

    -- Find the consecutive absences for each employee
    -- Find the consecutive absences for each employee
		SELECT 
			EmployeeID, 
			name,
             GROUP_CONCAT(absence_date   ORDER BY absence_date SEPARATOR ',') AS absence_dates
		FROM (
			SELECT 
				*
				 , case when exists(select 1 from temp_absences where employeeid = ta.employeeid and absence_date = DATE_ADD(ta.absence_date, INTERVAL 1 DAY)) then 1 else 0 end as OneDay    
			, case when exists(select 1 from temp_absences where employeeid = ta.employeeid and absence_date = DATE_ADD(ta.absence_date, INTERVAL 2 DAY)) then 1 else 0 end as TwoDay   
			 
			FROM temp_absences ta
            
		) AS consecutive_absences
        where OneDay =1 and TwoDay =1  -- Filter for 3 or more consecutive days
		GROUP BY EmployeeID, name 
		
		ORDER BY EmployeeID;

 

    -- Drop the temporary table to clean up
    DROP TEMPORARY TABLE IF EXISTS temp_absences;

 

	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetEmployeeTypeWiseCurrentDateData` ()  READS SQL DATA SELECT
    *,
    (
        TotalEmployees - Present - OnWeeklyOff - OnLeave
    ) AS Absent
FROM
    (
    SELECT
        e.EmpTypeName,
        COUNT(u.id) AS TotalEmployees,
        SUM(
            CASE WHEN ISNULL(a.id) = 1 THEN 0 ELSE 1
        END
) AS Present,
SUM(
    CASE WHEN u.Weekly_Off = DAYOFWEEK(CURDATE()) THEN 1 ELSE 0
    END) AS OnWeeklyOff,
Sum(
    CASE WHEN a.in_time > DATE_ADD(
        sh.Shift_Start_Time,
        INTERVAL 5 MINUTE
    ) THEN 1 ELSE 0
END
) AS LatePunch,
REPLACE
    (
        GROUP_CONCAT(
            CASE WHEN a.in_time > DATE_ADD(
                sh.Shift_Start_Time,
                INTERVAL 5 MINUTE
            ) THEN u.f_name ELSE ''
        END
    ),
    ',,',
    ''
) AS LateComers,
SUM(
    CASE WHEN ISNULL(l.Total_Days) = 1 THEN 0 ELSE l.Total_Days
END
) AS OnLeave
FROM
    all_users u
INNER JOIN shift__employee_type_master e ON
    e.id = u.employee_type
INNER JOIN shift_master sh ON
    u.shift_time = sh.id
LEFT OUTER JOIN all_attandencetable a ON
    u.Employee_id = a.Employee_id AND a.attandence_Date = CURRENT_DATE
LEFT OUTER JOIN _leave l ON
    u.Employee_id = l.Employee_id AND CURRENT_DATE BETWEEN l.Start_Date AND l.End_Date
WHERE
    (
        u.DOJ IS NULL OR u.DOJ <= CURRENT_DATE
    ) AND(
        u.termination_date IS NULL OR u.termination_date >= CURRENT_DATE
    )
GROUP BY
    e.EmpTypeName
) vw
ORDER BY
    EmpTypeName$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetLateComerByDate` (IN `InputDate` DATE)   BEGIN
    SELECT
        cl.date,
        sh.Shift_Name AS Shift_Name,
        sh.Shift_Start_Time AS Shift_Start_Time,

        d.Department_name,
        e.EmpTypeName,
        TRIM(
            REGEXP_REPLACE(
                CONCAT_WS(
                    ' ',
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.f_name, 1)),
                            LOWER(SUBSTRING(u.f_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.m_name, 1)),
                            LOWER(SUBSTRING(u.m_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.l_name, 1)),
                            LOWER(SUBSTRING(u.l_name, 2))
                        ),
                        ''
                    )
                ),
                '\\s+',
                ' '
            )
        ) AS name,
        a.in_time
    FROM
        all_users u
    INNER JOIN calendar cl ON
        1 = 1
    INNER JOIN shift__employee_type_master e ON
        u.employee_type = e.id
    INNER JOIN department_master d ON
        u.department = d.id
    JOIN shift_master sh ON
        u.shift_time = sh.id
    INNER JOIN all_attandencetable a ON
        u.Employee_id = a.Employee_id
        AND a.attandence_Date = cl.date
        AND a.in_time > ADDTIME(sh.Shift_Start_Time, '00:05:00')  -- Adding 5 minutes using ADDTIME
    WHERE
        (u.DOJ IS NULL OR u.DOJ <= cl.date)
        AND (u.termination_date IS NULL OR u.termination_date >= cl.date)
        AND cl.date = InputDate  -- Filtering based on the input date
    ORDER BY
        sh.Shift_Name,
        a.in_time,
        name;
END$$

