CREATE DEFINER=`root`@`localhost` PROCEDURE `GetSalaryAndOTDetails` (IN `p_shiftID` INT, IN `p_emptype` INT, IN `p_department` INT, IN `p_roleid` INT, IN `p_year` INT, IN `p_month` INT)   BEGIN
    -- Main query with optimized joins and conditions
    SELECT 
        u.id AS EmployeeID,  
        TRIM(
            REGEXP_REPLACE(
                CONCAT_WS(
                    ' ',
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.f_name, 1)),
                            LOWER(SUBSTRING(u.f_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.m_name, 1)),
                            LOWER(SUBSTRING(u.m_name, 2))
                        ),
                        ''
                    ),
                    COALESCE(
                        CONCAT(
                            UPPER(LEFT(u.l_name, 1)),
                            LOWER(SUBSTRING(u.l_name, 2))
                        ),
                        ''
                    )
                ),
                '\\s+',
                ' '
            )
        ) AS Name, 
        u.salary AS CTC,
        s.Shift_Name,
        d.Department_name,
        u.Department AS Department_id,
        e.EmpTypeName,
        u.employee_type as Employee_type_id,
        r.roles,
        u.role  as Role_id ,
        u.shift_time as Shift_id ,
        a.OT_Hours,
        a.OT_Amount,
        a.Salary_amount,
        a.Pay_Date,
        a.Paid_Amount
    FROM all_users u
    INNER JOIN department_master d ON u.Department = d.id
    INNER JOIN shift_master s ON u.shift_time = s.id
    INNER JOIN shift__employee_type_master e ON u.employee_type = e.id
    INNER JOIN role_masrer r ON u.role = r.id 
    INNER JOIN arrear_table a ON u.Employee_id = a.Employee_id
    WHERE 
        a.Arrear_Year = p_year
        AND MONTH(a.Arrear_Month) = IF(p_month = 0, MONTH(a.Arrear_Month), p_month) 
        AND (d.id = IF(p_department = 0, d.id, p_department))
        AND (e.id = IF(p_emptype = 0, e.id, p_emptype))
        AND (s.id = IF(p_shiftID = 0, s.id, p_shiftID))
        AND (r.id = IF(p_roleid = 0, r.id, p_roleid))
    ORDER BY u.id;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GetShitWiseCurrentDateData` ()  READS SQL DATA Select sh.Shift_Name, sh.Shift_Start_Time,
sh.Shift_End_Time, 
sh.Lunch_Start_Time, 
sh.Lunch_end_Time, 
sh.Shift_hours , 
count(u.id) as TotalEmployees,
(SELECT count(1) FROM all_attandencetable where attandence_Date=CURRENT_DATE and Employee_id = u.Employee_id) as Present,
sum(case when u.Weekly_Off = DAYOFWEEK(CURDATE()) then 1 else 0 end) as OnWeeklyOff,
SUM(case when a.in_time > DATE_ADD(sh.Shift_Start_Time, INTERVAL 5 MINUTE) then 1 else 0 end ) AS LatePunch,
REPLACE(GROUP_CONCAT(case when a.in_time > DATE_ADD(sh.Shift_Start_Time, INTERVAL 5 MINUTE) then  u.f_name else '' end),',,','') as LateComers,
Sum(case when isnull(l.Total_Days)=1 then 0 else l.Total_Days end ) AS OnLeave 
from all_users u 
inner join shift_master sh on u.shift_time = sh.id 
left outer join all_attandencetable a on u.Employee_id =  a.Employee_id  AND a.attandence_Date = CURRENT_DATE 
left outer join _leave l on u.Employee_id = l.Employee_id and CURRENT_DATE between l.Start_Date and l.End_Date
where (u.DOJ is null or u.DOJ<= CURRENT_DATE) and (u.termination_date is null or u.termination_date>= CURRENT_DATE) group by u.shift_time$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_calendar_data` ()   BEGIN
    DECLARE current_date_val DATE;
    DECLARE end_date DATE;
    
    -- Set the starting and ending dates
    SET current_date_val = '2024-01-01';
    SET end_date = '2030-12-31';
    
    -- Loop through all the dates from current_date_val to end_date
    WHILE current_date_val <= end_date DO
        -- Insert the data into the calendar table
        VALUES (
            current_date_val,                          -- The date
            DAY(current_date_val),                     -- The day of the month
            DAYOFWEEK(current_date_val),               -- The numeric day of the week (1=Sunday, 2=Monday, ..., 7=Saturday)
            MONTH(current_date_val),                   -- The month number
            YEAR(current_date_val)                     -- The year number
        );
        
        -- Move to the next day
        SET current_date_val = DATE_ADD(current_date_val, INTERVAL 1 DAY);
    END WHILE;
    
END$$

