DELIMITER $$
CREATE TRIGGER `after_update_attendance` AFTER UPDATE ON `attendance_info` FOR EACH ROW BEGIN
    -- Declare variables to store calculated values
    DECLARE min_time TIME;
    DECLARE max_time TIME;
    DECLARE shift_minutes INT;
    DECLARE total_minutes INT;
    DECLARE salary DECIMAL(10, 2);
    DECLARE holiday INT DEFAULT 0;
    DECLARE Swap INT DEFAULT 0;
    DECLARE WeeklyOffSwapped INT DEFAULT 0;
    DECLARE total_working_days INT;


	SET holiday = 0;
	SET Swap = 0;
	SET WeeklyOffSwapped = 0;
	
    -- Calculate MIN and MAX attendance times
    SELECT MIN(attendance_time), MAX(attendance_time)
    INTO min_time, max_time
    FROM attendance_info
    WHERE Employee_id = NEW.Employee_id AND attendance_Date = NEW.attendance_Date;

    -- Calculate total minutes and total working days
    SET total_minutes = TIMESTAMPDIFF(MINUTE, min_time, max_time);
    SET total_working_days = TIMESTAMPDIFF(
        DAY,
        CONCAT(YEAR(NEW.attendance_Date), '-', MONTH(NEW.attendance_Date), '-01'),
        DATE_ADD(CONCAT(YEAR(NEW.attendance_Date), '-', MONTH(NEW.attendance_Date), '-01'), INTERVAL 1 MONTH)
    );

    -- Fetch shift hours in minutes and salary
    SELECT shift_hours * 60, all_users.salary
    INTO shift_minutes, salary
    FROM shift_master, all_users
    WHERE shift_master.id = (SELECT shift_time FROM all_users WHERE Employee_id = NEW.Employee_id)
      AND all_users.Employee_id = NEW.Employee_id;

  -- Fetch data for the current date and employeeID in one query
SELECT 
    MAX(CASE 
        WHEN Swap_Date = NEW.attendance_Date AND public_holiday = 1 THEN 1 
        ELSE 0 
    END) AS isHoliday,
    MAX(CASE 
        WHEN Swap_Date = NEW.attendance_Date AND public_holiday = 0 THEN 1 
        ELSE 0 
    END) AS isWeeklyOffSwapped,
    MAX(CASE 
        WHEN Holiday_Date = NEW.attendance_Date THEN 1 
        ELSE 0 
    END) AS isSwap
INTO holiday, WeeklyOffSwapped, Swap
FROM all_holiday
WHERE Employee_id = NEW.Employee_id
  AND (Swap_Date = NEW.attendance_Date OR Holiday_Date = NEW.attendance_Date);

-- If no conditions were met, fallback to checking the holiday_master table
IF  IFNULL(holiday, 0) = 0 AND IFNULL(WeeklyOffSwapped, 0)  = 0 AND IFNULL(Swap, 0)  = 0 THEN
    SELECT 
        COUNT(*) 
    INTO holiday
    FROM holiday_master
    WHERE holiday_Date =NEW.attendance_Date;
END IF;

    -- Check if the record exists
    IF EXISTS (
        SELECT 1 
        FROM all_attandencetable 
        WHERE Employee_id = NEW.Employee_id 
          AND attandence_Date = NEW.attendance_Date
    ) THEN
        -- Update the existing record
        UPDATE all_attandencetable
        SET 
            in_time = min_time,
            out_time = max_time,
            Total_Time = TIMEDIFF(max_time, min_time),
            Total_Minutes = total_minutes,
            Totel_Hours = (total_minutes / 60.0),
            Shift_Hours = shift_minutes / 60,
            Overtime = CASE 
                WHEN total_minutes > shift_minutes THEN total_minutes - shift_minutes 
                ELSE 0 
            END,
            Public_Holiday = IFNULL(holiday, 0) ,
            updated_at = NOW(),
            TotalWorkingDays = total_working_days,
            ctc = salary,
            Daily_Rate = salary/total_working_days,
			Over_Ttime_Rate = salary/total_working_days/(shift_minutes ),
			Over_Time_Amount =  CASE 
                WHEN total_minutes > shift_minutes THEN total_minutes - shift_minutes 
                ELSE 0 
            END * (salary/total_working_days/(shift_minutes )),
			Normal_Minutes = CASE 
                WHEN total_minutes <= shift_minutes THEN total_minutes  
                ELSE shift_minutes 
            END,
			Swap_Day = IFNULL(Swap, 0),
			WeeklyOff = IFNULL(WeeklyOffSwapped, 0),
			Day_Total_Amount =  case when total_minutes > shift_minutes THEN salary/total_working_days else salary/total_working_days/(shift_minutes)*total_minutes  end 
        WHERE Employee_id = NEW.Employee_id 
          AND attandence_Date = NEW.attendance_Date;

    ELSE
        -- Insert a new record
            Employee_id, in_time, out_time, attandence_Date, created_by, updated_by, 
            created_at, updated_at, Total_Time, Total_Minutes, Totel_Hours, 
            Shift_Hours, Overtime, Public_Holiday, TotalWorkingDays, ctc, Over_Ttime_Rate, Over_Time_Amount,Daily_Rate,Swap_Day,WeeklyOff
        )
        VALUES (
            NEW.Employee_id,
            min_time,
            max_time,
            NEW.attendance_Date,
            NEW.created_by,
            NEW.created_by,
            NOW(),
            NOW(),
            TIMEDIFF(max_time, min_time),
            total_minutes,
           (total_minutes / 60.0),
            shift_minutes / 60,
            CASE 
                WHEN total_minutes > shift_minutes THEN total_minutes - shift_minutes 
                ELSE 0 
            END,
            IFNULL(holiday, 0),
            total_working_days,
            salary,
			salary/total_working_days/(shift_minutes ),
			CASE 
                WHEN total_minutes > shift_minutes THEN total_minutes - shift_minutes 
                ELSE 0 
            END * (salary/total_working_days/(shift_minutes )),
	    salary/total_working_days,
			IFNULL(Swap, 0),
			IFNULL(WeeklyOffSwapped, 0)
			
        );
    END IF;
END
$$
